goog.provide("goog.i18n.GraphemeBreakTest");goog.setTestOnly("goog.i18n.GraphemeBreakTest");goog.require("goog.i18n.GraphemeBreak");goog.require("goog.testing.jsunit");function testBreakNormalAscii(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak("a".charCodeAt(0),"b".charCodeAt(0),!0))}function testBreakAsciiWithExtendedChar(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak("a".charCodeAt(0),768,!0))}function testBreakSurrogates(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(55808,56320,!0));assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(56319,57343,!0))}function testBreakHangLxL(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(4352,4352,!0))}function testBreakHangL_T(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak(4352,4520))}function testBreakHangLVxV(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(44032,4448,!0))}function testBreakHangLV_L(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak(44032,4352,!0))}function testBreakHangLVTxT(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(44033,4520,!0))}function testBreakThaiPrependLegacy(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak(3648,3585))}function testBreakThaiPrependExtended(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak(3648,3585,!0))}function testBreakDevaSpacingMarkLegacy(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak(2325,2366))}function testBreakDevaSpacingMarkExtended(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(2325,2366,!0))}function testBreakDevaViramaSpace(){assertTrue(goog.i18n.GraphemeBreak.hasGraphemeBreak(2381,32))}function testBreakDevaViramaConsonant(){assertFalse(goog.i18n.GraphemeBreak.hasGraphemeBreak(2381,2325))}